Avoiding write skews in Spring Data MongoDB<p>I am trying to use Spring Data MongoDB transactions to avoid write skew errors. <a href="https://user-images.githubusercontent.com/49154776/153240259-f4eee7a3-db2d-4150-8b93-721e0f863a6b.png" rel="nofollow noreferrer">This diagram</a> explains the flow that happens in my example. I also posted the source code as a whole in <a href="https://github.com/jjarzynski/mongo-txample" rel="nofollow noreferrer">this repository</a>.</p>
<p>My service method that reads and updates the same document is <code>@Transactional</code>:</p>
<pre class="lang-kotlin prettyprint-override"><code>fun nextMessage(id: Int, text: String) = transactionReadWrite(id, text)
    ?.let { messages.save(it) }

@Transactional
fun transactionReadWrite(id: Int, text: String) = threads.findById(id)
    ?.write(text)
    ?.let { (threadUpdate, previousLatest) -&gt;
        threads.save(threadUpdate)
        log.info(&quot;Replacing \&quot;${previousLatest.text}\&quot; with \&quot;${threadUpdate.latestMessage.text}\&quot;&quot;)
        previousLatest
    }
</code></pre>
<p>But when I call <code>nextMessage()</code> with 5 different inputs in parallel, I can see some of them reading the same values at the same time, and then successfully updating the document:</p>
<pre><code>15:37:06.964 : Opened connection [connectionId{localValue:3, serverValue:1264}] to localhost:27017
15:37:07.308 : Replacing &quot;0&quot; with &quot;3&quot;
15:37:07.308 : Replacing &quot;0&quot; with &quot;4&quot;
15:37:07.310 : Replacing &quot;0&quot; with &quot;1&quot;
15:37:07.430 : Opened connection [connectionId{localValue:5, serverValue:1265}] to localhost:27017
15:37:07.430 : Opened connection [connectionId{localValue:6, serverValue:1266}] to localhost:27017
15:37:07.435 : Replacing &quot;1&quot; with &quot;2&quot;
15:37:07.440 : Replacing &quot;1&quot; with &quot;5&quot;
15:37:07.447 : Replacing &quot;5&quot; with &quot;another one&quot;
</code></pre>
<p><strong>How do you avoid write skew errors with Spring Data MongoDB transactions?</strong></p>

