Mongodb for projects with many to many relationships<p>I'm at the beginning of starting a project for learning backend development with a bit of frontend development. For that, I wanted to create a project around cooking recipes. The plan was to create an admin REST API that would be later used by a custom CMS to create, edit, delete,... recipes and a public api for a mobile app where your users can discover cooking recipes.
Simplicity wise, I thought about choosing Mongodb as the database. While creating a Mongodb schema, I came up with this idea:</p>
<ul>
<li>Three main collections</li>
</ul>
<pre class="lang-js prettyprint-override"><code>// Recipes (SKETCH!)
{
 id: ObjectId,
 title: {
  en: string,  // Multiple languages
  de: string,
  fr: string,
 },
 description: {
  en: string,  // Multiple languages
  de: string,
  fr: string,
 },
 author: ObjectId, // Id of the author inside the authors collection
 imageUrl: string,
 ...
 ingredients: 
[
 //Ids of the ingredients inside the ingredients collection
 {
  id: ObjectId,
  amount: number,
 },
{
  id: ObjectId,
  amount: number,
 }
 ...
],
 steps: {
  en: [],
  de: [],
  fr: []
 }
}
</code></pre>
<pre class="lang-js prettyprint-override"><code>// Author (SKETCH!)
{
 id: ObjectId,
 name: string,
 imageUrl: string,
 description: {
  en: string, // multiple languages
  de: string,
  fr: string,
 }
}
</code></pre>
<pre class="lang-js prettyprint-override"><code>// Ingredients (SKETCH!)
{
 id: ObjectId,
 name: {
  en: string,
  de: string,
  fr: string
 }
 imageUrl: string,
 // Based on 100g
 protein: number,
 carbs: number,
 calories: number,
}
</code></pre>
<p>My goal with this structure is to get the ingredients and the authors seperate from the recipes in order to update them independently. So, for example, when I edit my &quot;tomato&quot; ingredient, all recipes that contain this ingredient get updated too, in the sense that they only contain the ids of the ingredients. The same goes for the author.
Now I'm asking myself if this kind of structure isn't more suited to a sql database.
Would this structure make any significant performance/cost difference between a sql and a nosql/mongodb database?
Just as an example, if I had a recipe that contains 20 ingredients, wouldn't that be
20(Ingredients) + 1 (author) + 1 (recipe itself) = 22 documents reads to get a whole recipe(is sql much faster here)? Is that fast enough or does that even make sense cost/ performance wise?</p>
<p>And one last question: how many concurrent connections would be possible with a Mongodb database?</p>

