Could someone tell me the difference between these two MongoDB queries<p>I was given the following problem in MongoDB:</p>
<p>How many companies in the sample_training.companies dataset were</p>
<ol>
<li>(Either founded in 2004 &amp;&amp; ( either have the social category_code [or] web category_code))<br />
|| (founded in the month of October &amp;&amp; ( either have the social category_code [or] web category_code))</li>
</ol>
<p>The actual query for the above question is given below and it returned 149 documents.</p>
<p><strong>CorrectQuery:</strong></p>
<pre><code>db.companies.find({
  &quot;$or&quot;:[
    {
      &quot;founded_year&quot;:2004,
      &quot;$or&quot;:[
        { &quot;category_code&quot;:&quot;social&quot; },
        { &quot;category_code&quot;:&quot;web&quot; }
      ]
    },
    {
      &quot;founded_month&quot;:10,
      &quot;$or&quot;:[
        { &quot;category_code&quot;:&quot;social&quot; },
        { &quot;category_code&quot;:&quot;web&quot; }
      ]
    }
  ]
}).count()
</code></pre>
<p>But I've tried to formulate another query for the same problem, unfortunately, it returned the incorrect value of 668 rows.</p>
<p><strong>Incorrect Query:</strong></p>
<pre><code>db.companies.find({
  &quot;$or&quot;:[
    {&quot;category_code&quot;:&quot;social&quot;},
    {&quot;category_code&quot;:&quot;web&quot;}
  ],
  &quot;$or&quot;:[
    {&quot;founded_year&quot;:2004},
    {&quot;founded_month&quot;:10}
  ]
}).count()
</code></pre>
<p>Could someone help me in understanding the difference between these queries?</p>

