Should I use GridFS or some other method to create a file sharing app?<p>I am currently beginning work on a file sharing app for my company. A simple form to upload a file, the user is then given a download URL and can past that on to anyone so they can download the file (Similar to products such as WeTransfer).</p>
<p>However I am struggling on decided how to do it. I have been playing with MongoDB and GridFS. I have successfully used multer and multer-gridfs-storage to upload files directly into my database. I am struggling to get them to download as I don't know that much about GridFS.</p>
<pre><code>const storage = new GridFsStorage({
url: 'mongodb://localhost:27017/fileUpload',
file: (req, file) =&gt; {
    return new Promise((resolve, reject) =&gt; {
        crypto.randomBytes(16, (err, buf) =&gt; {
            if (err) {
                return reject(err)
            }
            const filename = buf.toString('hex') + path.extname(file.originalname);
            const fileInfo = {
                filename: filename,
                bucketName: 'uploads'
            };
            resolve(fileInfo)
