<p>I have my collection with documents in mongodb  with value from sequential ranges as follow :</p>
<pre><code> {x:1}
 {x:2}
 {x:3}
 {x:5}
 {x:6}
 {x:7}
 {x:8}
 {x:20}
 {x:21}
</code></pre>
<p>I need to extract a list of sequential ranges in the form(the count is not compulsory , but I need at least the first and last values from the range):</p>
<pre><code> {x:[1,3] , count:3}
 {x:[5,8], count:4}
 {x:[20,21],count:2}
</code></pre>
<p>or</p>
<pre><code> { min:1 , max:3 , count:3}
 { min:5 , max:8 , count:4}
 { min:20 , max:21 , count:2}
</code></pre>
<p>Please,  advice suitable solution , collection has ~100M docs , some of the values are in 10 digit ranges others in 15 digit ranges , but they are all sequentially incremental in their range?</p>
<p>Task 2:</p>
<p>Same think like in Task 1 , but taken based on custom sequence step ,
for example if the sequence step is 3:</p>
<pre><code>{y:1}
{y:3}
{y:5}
{y:20}
{y:22}
</code></pre>
<p>need to produce:</p>
<pre><code>{y:[1,5] ,count:3}
{y:[20,22]} , count:2}
</code></pre>
<p>Thanks!</p>
<p>P.S.
I succeeded partially to get some ranges picture by fetch distribution by  number of digits range  , but this seems to be very general:</p>
<pre><code> db.collection.aggregate([
   {
     $addFields: {
       range: {
         $strLenCP: {
           $toString: &quot;$x&quot;
         }
       }
     }
   },
   {
     $group: {
       _id: &quot;$range&quot;,
       minValue: {
         $min: &quot;$x&quot;
       },
       maxValue: {
         $max: &quot;$x&quot;
       },
       Count: {
         $sum: 1
       }
     }
   },
   {
     $addFields: {
       x: [
         {
           $toString: &quot;$minValue&quot;
         },
         {
           $toString: &quot;$maxValue&quot;
         }
       ]
     }
   },
   {
     $project: {
       range: &quot;$_id&quot;,
       &quot;_id&quot;: 0,
       x: 1,
       Count: 1
     }
   },
   {
     $sort: {
       range: 1
     }
   }
 ])
</code></pre>
